import React, {useEffect} from 'react';
import Container from "../../Components/Container/Container";
import {useHttp} from "../../Hooks/http.hook";
import {getAllRopes} from "../../http/ropesinStockAPI";

const RopesInStock = () => {

    useEffect( () => {
        getAllRopes()
    }, []);

    return (
        <Container>
            <div>
                Ropes in stock page
            </div>
        </Container>
    );
};

export default RopesInStock;
